      allowNull: true
    },
    prov_modified_date: {
      type: DataTypes.DATE,
      allowNull: true
    },
    prov_country_code: {
      type: DataTypes.STRING(3),
      allowNull: false,
      references: {
        model: 'country',
        key: 'country_code'
      }
    }
  }, {
    sequelize,
    tableName: 'province',
